''' https://leetcode.com/problems/shortest-path-in-binary-matrix/
'''

class Solution:
    def shortestPathBinaryMatrix(self, grid):

        # Can't ven start
        if grid[0][0] == 1:
            return -1

        # Stack for flood filling the maze
        flood_queue = [(0, 0)]
        # Since 1 is used for "obstacle", will count steps from 2
        grid[0][0] = 2


        directions = [(1, 1), (-1, -1), (-1, 0), (-1, 1), (0, -1), (0, 1), (1, -1), (1, 0), ]


        while flood_queue:
            x, y = flood_queue.pop()
            curr_step = grid[x][y]

            # Check 8 directions around the cell
            for dx, dy in directions:
                new_x = x + dx
                new_y = y + dy

                # CHeck if it is not out of bounds
                if new_x < 0 or new_x == len(grid) or new_y < 0 or new_y == len(grid[0]):
                    continue

                # Ignore an obstacle
                if grid[new_x][new_y] == 1:
                    continue
                # Fill in new number if it is 0 or if we improving the result 
                if curr_step + 1 < grid[new_x][new_y] or grid[new_x][new_y] == 0:
                    grid[new_x][new_y] = curr_step + 1
                    flood_queue.append((new_x, new_y))

        # If last cell is 0 or 1 - it was never reached or is an obstacle
        if grid[-1][-1] in (0, 1):
            return -1
        # Otherwise the answer is last cell - 1 (because we started at 2)
        return grid[-1][-1] - 1

def print_matrix(matrix):
    maxlen = len(str(max((max(line) for line in matrix))))

    for line in matrix:
        #print(" ".join([str(i).rjust(maxlen, " ") for i in line]))
        print("".join([str(i) for i in line]))

